-- Rainbow Menu with Movable Watermark
-- Generated by RobLuaScripts

-- Create ScreenGui
local ScreenGui = Instance.new("ScreenGui")
ScreenGui.Parent = game.CoreGui
ScreenGui.ResetOnSpawn = false

-- Create Watermark Frame
local Watermark = Instance.new("Frame")
Watermark.Name = "AslanHubWatermark"
Watermark.Size = UDim2.new(0, 200, 0, 50)
Watermark.Position = UDim2.new(0.5, -100, 0.1, 0)
Watermark.BackgroundTransparency = 0.5
Watermark.BackgroundColor3 = Color3.fromRGB(0, 0, 0)
Watermark.Parent = ScreenGui

-- Create Rainbow Border using UIStroke
local UIStroke = Instance.new("UIStroke")
UIStroke.Parent = Watermark
UIStroke.Thickness = 2
UIStroke.ApplyStrokeMode = Enum.ApplyStrokeMode.Border

-- Create Watermark Text
local WatermarkText = Instance.new("TextLabel")
WatermarkText.Name = "WatermarkText"
WatermarkText.Size = UDim2.new(1, 0, 1, 0)
WatermarkText.BackgroundTransparency = 1
WatermarkText.Text = "Aslan Hub"
WatermarkText.TextColor3 = Color3.fromRGB(255, 255, 255)
WatermarkText.TextSize = 24
WatermarkText.Font = Enum.Font.GothamBold
WatermarkText.Parent = Watermark

-- Make Watermark Draggable
local UserInputService = game:GetService("UserInputService")
local dragging
local dragInput
local dragStart
local startPos

local function update(input)
    local delta = input.Position - dragStart
    Watermark.Position = UDim2.new(startPos.X.Scale, startPos.X.Offset + delta.X, startPos.Y.Scale, startPos.Y.Offset + delta.Y)
end

Watermark.InputBegan:Connect(function(input)
    if input.UserInputType == Enum.UserInputType.MouseButton1 or input.UserInputType == Enum.UserInputType.Touch then
        dragging = true
        dragStart = input.Position
        startPos = Watermark.Position
        
        input.Changed:Connect(function()
            if input.UserInputState == Enum.UserInputState.End then
                dragging = false
            end
        end)
    end
end)

Watermark.InputChanged:Connect(function(input)
    if input.UserInputType == Enum.UserInputType.MouseMovement or input.UserInputType == Enum.UserInputType.Touch then
        dragInput = input
    end
end)

UserInputService.InputChanged:Connect(function(input)
    if input == dragInput and dragging then
        update(input)
    end
end)

-- Rainbow Effect
local function updateRainbow()
    local hue = 0
    while wait() do
        hue = (hue + 1) % 360
        local color = Color3.fromHSV(hue/360, 1, 1)
        UIStroke.Color = color
    end
end

-- Start Rainbow Effect
coroutine.wrap(updateRainbow)()
